s=\"flex gap-2 align-center\">\r\n<a href=\"/calendars/\">\r\n[vicon vicon=\"calendar text-2xl\" color=\"#83ac2a\"]\r\n<div class=\"flex flex-col gap-2\"><strong>Calendar</strong><span class=\"text-sm\">View your teams work on a shared calendar.</span></div></a>\r\n</div>\r\n&nbsp;\r\n\r\n</div>\r\n<div class=\"flex flex-col p-2 w-64 rounded hover:bg-slate-50\">\r\n\r\n&nbsp;\r\n<div class=\"flex gap-2 align-center\">\r\n<a href=\"/kb/\">\r\n[vicon vicon=\"info-alt text-2xl\" color=\"#daae1b\"]\r\n<div class=\"flex flex-col gap-2\"><strong>Knowledge Base</strong><span class=\"text-sm\">Create shared Knowledge base for Team.</span></div></a>\r\n</div>\r\n&nbsp;\r\n\r\n</div>\r\n<div class=\"flex flex-col p-2 w-64 rounded hover:bg-slate-50\">\r\n\r\n&nbsp;\r\n<div class=\"flex gap-2 align-center\">\r\n<a href=\"/lms\">\r\n[vicon vicon=\"book text-2xl\" color=\"#83ac2a\"]\r\n<div class=\"flex flex-col gap-2\"><strong>LMS</strong><span class=\"text-sm\">Learning management, compliance trainings</span></div></a>\r\n</div>\r\n&nbsp;\r\n\r\n</div>\r\n<div class=\"flex flex-col p-2 w-64 rounded hover:bg-slate-50\">\r\n\r\n&nbsp;\r\n<div class=\"flex gap-2 align-center\">\r\n<a href=\"/helpdesk\">\r\n[vicon vicon=\"headphone-alt text-2xl\" color=\"#83ac2a\"]\r\n<div class=\"flex flex-col gap-2\"><strong>Helpdesk</strong><span class=\"text-sm\">Integrated helpdesk and ticketing system.</span></div></a>\r\n</div>\r\n&nbsp;\r\n\r\n</div>\r\n<div class=\"flex flex-col p-2 w-64 rounded hover:bg-slate-50\">\r\n\r\n&nbsp;\r\n<div class=\"flex gap-2 align-center\">\r\n<a href=\"/clients\">\r\n[vicon vicon=\"blackboard text-2xl\" color=\"#ff25e6\"]\r\n<div class=\"flex flex-col gap-2\"><strong>Client Portals</strong><span class=\"text-sm\">Allow clients to view project progress.</span></div></a>\r\n</div>\r\n</div>\r\n&nbsp;\r\n\r\n</div>\";s:16:\"micronet_columns\";s:1:\"4\";}}','yes');
